  // 标绘工具箱初始化
  public plotInit() {
      return new Promise<void>((resolve, reject) => {
          // 延迟渲染，第一次打开的时候渲染
          //     this.$nextTick(() => {
          // 懒加载
          if (this.rendered === false) {
              this.rendered = true;
              this.$nextTick(() => {
                  // 懒加载
                  const self: any = this;
                  const mapId = 'map';
                  self.resolveMap(mapId).then((event: any) => {
                      this.initialize(event.map);
                      resolve();
                  });
              });
          } else {
              resolve();
          }
          // });
      });
  }
  // 打开面板
  public plotOpen() {
      return new Promise<void>(async (resolve, reject) => {
          // this.leftTabArr = ['常用标绘', '应急标绘符号'/* , '基础标绘符号', '管理标绘' */];
          await this.plotInit();
          this.refreshSchemaList();
          // $('#plotCtrlMainWrap').fadeIn();
          $('#plotCtrlMainWrap').css('visibility', 'visible');
          $('.emap_control_plotCtrl_top').css('visibility', 'visible');
          $('.emap_control_plotCtrl_top').removeClass('plotCtrlTop-highlight');
          $('.topClose').css('visibility', 'visible');
          $('.topVisible-collapse').css('visibility', 'visible');
          $('.topVisible-expand').css('visibility', 'hidden');
          resolve();
      });
  }
  /**
   * 获取地图，检查地图加载完成后进入回调
   * @param tag
   */
  public resolveMap(tag: string) {
      return new Promise((resolve: any , reject: any) => {
          const temp: any = this;
          // 先从容器中找地图，如果没有，则监听地图初始化完成的事件
          const mapData = (temp.$ioc as any).resolve(`map-${tag}`);
          if (mapData && mapData.ready === true ) {
              resolve({
                  map: mapData.map,
              });
          } else {
              // 监听地图加载完成的回调
              (this.messsageBus as any).$on(`map-ready-${tag}`, (event: any) => {
                  resolve({
                      map: event.map,
                  });
              });
          }
      });
  }
  private init() {
    if (this.messageBus) {
        this.messageBus.off('mapDemension');
        this.messageBus.on('mapDemension', (opts: any) => {
          this.switchMap(opts);
        });
    }
  }
  private switchMap(val: any) {
    this.mapDimensionality = val.type;
    if (this.mapComponent) {
      this.mapComponent.switchMap(val);
    } else {
      this.map3D = val.map;
    }
  }
  private created() {
    // 新增messsageBus的监听
    this.messageBus = this.messageBus || this.messsageBus;
    // this.init();
    return false;
  }
  private mounted() {
      this.init();
      this.currentTab = this.activeTab ? this.activeTab : 'first';
      this.plotOpen();
  }
  // 点击图标
  private childrenClick(indexChild: any, itemChild: any, item: any) {
    this.checkedFalse();
    itemChild.checked = !itemChild.checked;
    this.itemChilda = itemChild;
    this.mapComponent.draw(itemChild, this.mapOpts.businessId);
  }
  // 标绘方案显示
  private showScheme(item: any) {
    // 未保存的显隐控制--隐藏-false --显示--true
    this.mapComponent.toggleUnsavedPlot(item.id, true);
    item.showSchemeButton = false;
  }
  // 标绘方案隐藏
  private hiddenScheme(item: any) {
    // 未保存的显隐控制--隐藏-false --显示--true
    this.mapComponent.toggleUnsavedPlot(item.id, false);
    item.showSchemeButton = true;
  }
  // 标绘方案移除
  private removeScheme(item: any, index: any) {
    // 地图图标标绘移除方法
    this.mapComponent.removeUnsaved(item.id);
    this.schemeList.splice(index, 1);
  }
  // 标绘方案保存
  private saveNameClick() {
    if (this.schemeList.length > 0) {
      const time = this.nowTimeFn();
      const name = '方案' + time;
      if (G.flag === true) {
          const opts = {
              schemaName : G.bjData.val,
              id : G.bjData.id,
          };
          this.mapComponent.editSchema(this.mapOpts.businessId, opts);
          G.flag = false;
      } else {
          this.mapComponent.savePlotSchema(
              this.mapOpts.businessId,
              name,
              1,
              9,
          );
      }
      this.checkedFalse();
      // 清除图标选中效果
      // for (let i = 0; i < this.tabList.length; i++) {
      //   for (let k = 0; k < this.tabList[i].children.length; k++) {
      //     this.tabList[i].children[k].checked = false;
      //   }
      // }
      // 清除编辑数据
      this.edititems = [];
      this.schemeList = [];
    } else {
      return this.$message('标绘为空，不能保存');
    }
  }
  private checkedFalse() {
    this.tabList.slice().reverse().forEach((item: any, index: any, arr1: any) => {
        const itemchildren = item.children;
        itemchildren.slice().reverse().forEach((itemc: any, indexc: any, arr1c: any) => {
          itemc.checked = false;
        });
      });
  }
  // 获取当前时间
  private nowTimeFn() {
      const today = new Date();
      const year = today.getFullYear();     // 获取当前时间的年份
      let month = today.getMonth() + 1;   // 获取当前时间的月份，月份从0开始，所以需要加一
      let day = today.getDate();          // 获取当前时间的日期，getDay()可以获取星期几
      let h = today.getHours();
      let m = today.getMinutes();
      let s = today.getSeconds();
      // 在 numbers<10 的数字前加上 0
      month = this.checkTime(month);
      day = this.checkTime(day);
      h = this.checkTime(h);
      m = this.checkTime(m);
      s = this.checkTime(s);
      const nowTime = year + '-' + month + '-' + day + ' ' + h + ':' + m + ':' + s;
      return nowTime;
  }
  private checkTime(i: any) {
      if (i < 10) {
          i = '0' + i;
      }
      return i;
  }
  // 点击列表
  private openProp(item: any, index: any) {
    if (this.oldItemData) {
      this.hiddenList(this.oldItemData);
      this.activeIndex = false;
      if (this.oldItemData.id === item.id) {
        if (this.activeIndexflag) {
          this.showList(item);
          this.activeIndexflag = false;
          this.activeIndex = item.id;
        } else {
          this.hiddenList(item);
          this.activeIndexflag = true;
          this.activeIndex = false;
        }
      } else {
        this.showList(item);
        this.activeIndexflag = false;
        this.activeIndex = item.id;
      }
    } else {
      this.showList(item);
      this.activeIndexflag = false;
      this.activeIndex = item.id;
    }
    if (this.activeIndex) {
      G.clickedItemID = item.id;
    } else {
      G.clickedItemID = '';
    }
    this.oldItemData = item;
  }
  // 点击列表名称
  private listNameChange(item: any) {
    this.mapComponent.planShowBack(item.id);
    // item.showInput = true;
    this.editInputFlag = item;
  }
  // 保存列表名称
  private nameSave(item: any) {
    if (item.val !== '') {
      const opts = {
        schemaName : item.val,
        id : item.id,
      };
      this.mapComponent.editSchema(this.mapOpts.businessId, opts);
      // item.showInput = false;
      this.editInputFlag = {};
      item.showListButton = false;
    } else {
      return this.$message('方案名称不能为空');
    }
  }
  // 组件初始化
  private async initialize(map: any) {
      console.log('初始化标绘');
      // this.mapComponent = new PlotManagerMapComponent({businessId: this.mapOpts.businessId});
      // this.mapComponent.destroy();
      this.mapComponent = new PlotManagerMapComponent({businessId: '2f2ee16f-44ac-c7ed-c8ba-52ec60a1a1fe'});
      // this.mapComponent.destroy();
      // 初始化标绘组件
      this.mapComponent.addControl({map, map3D: this.map3D, mapDemension: this.mapDimensionality});
      const plotConf: any = G.service;
      // 初始化查询
      this.map = map ;
      plotNoSqlService.options = plotConf;
      plotNoSqlService.options.serverUrl = publishObjectPath.value.emapService;
      plotNoSqlService.dataSetId1 = 'planPlotData';
      plotNoSqlService.deserializer = new g2.core.Deserializer();
      this.mapComponent.setService(plotNoSqlService);
      // 事件注册
      this.mapComponentEvents();
      // 数据初始化
      this.plotIcons = await plotServer.getPlotIcons();
      // 设置图标
      this.mapComponent.setIcons(this.plotIcons);
      // this.initTabContent();
  }
  private mapComponentEvents() {
    const self = this;
    // 点击标绘图形打开编辑面板
    this.mapComponent.off('plotElementClick');
    this.mapComponent.on('plotElementClick', (data: any) => {
      const temp: any = data;
      // console.log(data);
      this.checkedFalse();
      if (data.businessId === self.mapOpts.businessId) {
        this.getEMapPanelEdit({ data: temp, key: temp.symbol.type });
      } else {
        // console.debug('businessPlotStartEdit', data);
        this.messsageBus.emit('businessPlotStartEdit', data);
      }
    });
    // 每次绘制完成时调用
    this.mapComponent.off('updateUnsavedView');
    this.mapComponent.on('updateUnsavedView', (data: any) => {
        // console.log('每次绘制完成时调用', data);
        // 数据列表中包含通过标绘工具箱绘制的全部图形，通过businessId排除外部标绘图形
        const list: any = [];
        this.checkedFalse();
        data.data.forEach((item: any) => {
            if (item.businessId === this.mapOpts.businessId) {
                this.$set(item, 'showSchemeButton', false);
                list.push(item);
            }
        });
        // 判断是否是编辑状态
        if (this.edititems.length > 0) {
          this.schemeList = this.edititems.concat(list);
        } else {
          this.schemeList = list;
        }

    });
    // 查询标绘方案列表回调
    this.mapComponent.off('refreshSchemaList');
    this.mapComponent.on('refreshSchemaList', (opts: any) => {
        self.tableData = opts.data.data;
        const that = self;
        self.tableData.forEach((item: any, index: any) => {
          if (that.oldtableData.length > 0 && that.oldtableData.length !== that.tableData.length && index === 0) {
            that.activeIndex = item.id;
          }
          if (G.clickedItemID) {
            that.activeIndex = G.clickedItemID;
          }
          this.$set(item, 'showListButton', true);
          this.$set(item, 'showInput', false);
        });
        that.oldtableData = that.tableData;
    });
    // 关闭编辑面板
    this.mapComponent.off('clearEditPanel');
    this.mapComponent.on('clearEditPanel', () => {
      self.closeEMapPanelEdit();
    });
  }
   // 调用面板编辑;
  private getEMapPanelEdit(opt: any) {
    // console.debug('编辑内容', opt);
    this.eMapPanelEditObj = opt;
    if (opt.key === 'point') {
      $('#eMapPanelEdit').fadeOut();
      return;
    }
    this.showPanelEdit = true;
  }
  // 关闭面板编辑
  private closeEMapPanelEdit() {
    this.eMapPanelEditObj = {
      data: {
        id: '',
        schemaId: '',
        businessId: '',
      },
    };
    $('#eMapPanelEdit').fadeOut();
    this.showPanelEdit = false;
    this.setChildCkedFalse(this.itemChilda);
  }
  private setChildCkedFalse(itemChilda: any) {
    const self = this;
    if (itemChilda) {
 this.tabList.filter((item: any) => {
      const children = item.children;
      children.filter((itema: any) => {
        return itema.iconName === itemChilda.iconName ?
             itema.checked = false
             :
             itema;
      });
    });
    }
  }
  // -图形编辑器-
  private eMapPanelEdit(val: any) {
      // console.debug('编辑后的标绘符号', val);
      this.mapComponent.plotElementUpdate(val);
  }
  // 关闭编辑
  private panelEditClose(val: any) {
      // this.showPanelEdit = false;
      this.closeEMapPanelEdit();
  }
  // 删除标绘-编辑框点击
  private deletePlotOnEdit(id: any) {
      this.mapComponent.removeUnsaved(id);
      this.showPanelEdit = false;
      this.schemeList.forEach((item: any, index: any) => {
        if (item.id === id) {

          this.schemeList.splice(index, 1);
          return false;
        }
      });
  }
  // 刷新标绘列表
  private refreshSchemaList() {
      this.listObj.currentPage = 1;
      this.listObj.inputKey = '';
      this.getlistDatas(this.listObj);
  }
  // 请求数据
  private getlistDatas(opt?: any) {
      this.mapComponent.refreshPlotSchemaList(this.mapOpts.businessId, opt.currentPage , this.limit);
  }
  // 编辑列表
  private editList(item: any) {
      G.flag = true;
      G.bjData = item;
      console.log('编辑列表');
      this.mapComponent.planShowBack(item.id);
      this.mapComponent.planQueryBack(item.id).then((schema: any) => {
        console.log(schema);
        schema.elements.forEach((itema: any) => {
          this.$set(itema, 'showSchemeButton', false);
          this.$set(itema, 'content', itema.name);
        });
        this.edititems = schema.elements;
        this.schemeList = schema.elements;
        console.log(this.schemeList);
      });
  }
  // 显示列表
  private showList(item: any) {
    item.showListButton = false;
    this.mapComponent.planShowBack(item.id);
  }
  // 隐藏列表
  private hiddenList(item: any) {
    item.showListButton = true;
    this.mapComponent.planCleanBack(item.id);
  }
  // 删除列表
  private deleteList(item: any) {
    // 去mongodb库里删除已保存选中的标绘
    this.mapComponent.planDeleteBack(this.mapOpts.businessId, item.id, this.listObj.currentPage, this.limit);
  }
  // 打印列表
  private printList(item: any) {
      this.messsageBus.emit('mapPrintEmit', { isShow: true });
  }
  //   const domId = 'aidDecisionMakingLayoutMain';
  //     const screenShot = new G.common.ScreenShot({
  //         map: this.map,
  //     });
  //     screenShot.downloadImage(domId || null, '截屏');
  // }
  private destroyed() {
    this.mapComponent.destroy();
  }
  private beforeDestroy() {
    this.mapComponent.removeControl();
  }
}
</script>

